/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";
import type UI5Element from "@ui5/webcomponents-base/dist/UI5Element.js";
import type Option from "../../Option.js";
import type { ClassMapValue } from "@ui5/webcomponents-base/dist/types.js";

function block0 (this: Option, context: UI5Element, tags: string[], suffix: string | undefined) { return html`<li part="native-li" data-sap-focus-ref tabindex="${ifDefined(this._effectiveTabIndex)}" class="${classMap(this.classes.main as ClassMapValue)}" @focusin="${this._onfocusin}" @keyup="${this._onkeyup}" @keydown="${this._onkeydown}" draggable="${ifDefined(this.movable)}" @click="${this._onclick}"  role="option" title="${ifDefined(this.tooltip)}" ><div part="content" id="${ifDefined(this._id)}-content" class="ui5-li-content">${ this.displayIconBegin ? block1.call(this, context, tags, suffix) : undefined }<div class="ui5-li-text-wrapper"><span part="title" class="ui5-li-title"><slot></slot></span>${ this.additionalText ? block2.call(this, context, tags, suffix) : undefined }</div></div></li> `;}
function block1 (this: Option, context: UI5Element, tags: string[], suffix: string | undefined) { return suffix ? html`<${scopeTag("ui5-icon", tags, suffix)} part="icon" name="${ifDefined(this.icon)}" class="ui5-li-icon" mode="Decorative"></${scopeTag("ui5-icon", tags, suffix)}>` : html`<ui5-icon part="icon" name="${ifDefined(this.icon)}" class="ui5-li-icon" mode="Decorative"></ui5-icon>`;}
function block2 (this: Option, context: UI5Element, tags: string[], suffix: string | undefined) { return html`<span part="additional-text" class="ui5-li-additional-text">${ifDefined(this.additionalText)}</span>`;}


export default block0;
